import React from "react";

import Card from "react-bootstrap/Card";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";
import Container from "react-bootstrap/Container";
import "./index.css";
import logo from "./assets/logo@3x.png";
import banner from "./assets/banner.jpg";
import relogio from "./assets/relogio.png";
import baloes from "./assets/baloes.png";
import useState from "react";
import { Form, Input } from "@rocketseat/unform";
import Axios from "axios";
export default function PartyHunt() {
  const [values, setValues] = useState("");

  function onChange(ev) {
    const { name, value } = ev.target;

    setValues({ ...values, [name]: value });
  }

  async function onSubmit() {
    await Axios.post("http://mockbin.com/request?foo=bar&foo=baz", values).then(
      (response) => {
        console.log(response);
        if (response.status === 200) {
          alert("Mensagem enviada com sucesso!");
        } else {
          alert("Erro ao enviar mensagem.");
        }
      }
    );
  }

  return (
    <div>
      <nav className='corlogo'>
        <div>
          <img src={logo} alt='logo' className='logo' />

          <button className='botao'>Inicio</button>
          <button>Sobre</button>
          <button>Serviços</button>
          <button>Contato</button>
        </div>
      </nav>

      <Card>
        <Card.Img src={banner} alt='Card image' className='banner' />
        <Card.ImgOverlay>
          <div className='texto'>
            <h1>Entregando cargas e sonhos</h1>
            <p>
              Desde 1980 entregando cargas e fazemos pessoas negocios sorriem e
              se realizarem
            </p>
          </div>
        </Card.ImgOverlay>
      </Card>

      <Container>
        <Row className='fon'>
          <Col xs={12} md={8}>
            <div className='bla'>
              <h2>Entregas Rapidas e eficientes</h2>
              <h4>
                temos experiencia de cargas para pessoas e empresas em tempo
                recorde para o Brasil
              </h4>
            </div>
          </Col>
          <Col xs={6} md={4}>
            <img src={relogio} alt='logo' className='relogio' />
          </Col>
        </Row>
      </Container>

      <Container>
        <Row className='fon'>
          <Col xs={12} md={8}>
            <div className='bla'>
              <h2>Fale conosco</h2>
              Nome
              <div>
                <input type='text' />
              </div>
              E-mail
              <div>
                <input type='text' />
              </div>
              Mensagem
              <div>
                <input type='text' />
              </div>
              <button>Enviar</button>
            </div>
          </Col>
          <Col xs={6} md={4}>
            <img src={baloes} alt='logo' className='baloes' />
          </Col>
        </Row>
      </Container>

      <footer>
        <div className='footer'>© 2021 Guepardo Transportes</div>
      </footer>
    </div>
  );
}
